import React from 'react'
import './footer.css'

const Footer = () => {
  return (
    <Footer>

        <ul className='permalinks '>
            <li><a href="#">Hjem</a></li>
            <li><a href="#Kurser">Kurser</a></li>
        </ul>

    </Footer>
  )
}

export default Footer
